import React from 'react';
import { StyleSheet, View, Text, Image } from 'react-native';
import {useDispatch, useSelector} from "react-redux";
import { MediumAppText, BoldAppText } from '../styles/text'
import Divider from '../components/Divider'
import { VictoryArea, VictoryChart, VictoryTheme } from 'victory-native';
import _, { values } from 'lodash';

function MoodGraph () {

  const historicalData = useSelector((state) => state.historicalData);

  const feelingData = _.map(historicalData, el => el.feeling)
  const dateData = _.map(historicalData, el => el.date)
  const combinedData = [feelingData, dateData]

  function create(array1, array2) {
    let list = [];
    let count = 0;
    for (let i of array1) {
      let obj = {}
      obj.date = i
      obj.feeling = array2[count]
      list.push(obj)
      count++
    }
    return list
  }

  const combinedList = create(dateData, feelingData)

  // console.log(feelingData)
  // console.log(dateData)
  // console.log(combinedData)
  console.log(combinedList)

  // const newData = [
  //   {date: 1, feeling: 2 }
  // ]

  const data = [
    { quarter: 1, earnings: 13000 },
    { quarter: 2, earnings: 16500 },
    { quarter: 3, earnings: 14250 },
    { quarter: 4, earnings: 19000 }
  ];


  return (
    <View style={styles.container}>
      <MediumAppText>Hello</MediumAppText>
      <BoldAppText>MoodGraph</BoldAppText>
      <VictoryChart width={350} theme={VictoryTheme.material}>
      <VictoryArea data={data} x="date" y="feeling"/>
      </VictoryChart>
      <Divider/>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
  },
});



export default MoodGraph;
